import React from 'react';
import { AboutContanier } from '../Aboutpage/About.elements';
import { SkillContanier, SkillBox, SkillTitle, SkillIcon } from './Service.elements';


const Service = () => {
    return(
        <AboutContanier>
            <SkillContanier>
                <SkillBox>
                    <SkillTitle>
                        <div>
                            <SkillIcon ti />
                        </div>
                        <div>Artificial <br/> Intelligence</div>
                    </SkillTitle>
                </SkillBox>
            </SkillContanier>
        </AboutContanier>
    );
}

export default Service;
